CREATE DATABASE httm;

USE httm;

CREATE TABLE tblUser (
    id INT AUTO_INCREMENT PRIMARY KEY,
    username VARCHAR(50) UNIQUE NOT NULL,
    password VARCHAR(255) NOT NULL,
    fullname VARCHAR(100),
    phoneNumber VARCHAR(20) UNIQUE,
    email VARCHAR(100) UNIQUE
);

CREATE TABLE tblProduct (
    id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    brand VARCHAR(50),
    des TEXT,
    price FLOAT NOT NULL,
    quantity INT NOT NULL DEFAULT 0
);

CREATE TABLE tblOrder (
    id INT AUTO_INCREMENT PRIMARY KEY,
    tblUserId INT NOT NULL, 
    createdTime DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    
    FOREIGN KEY (tblUserId) REFERENCES tblUser(id) 
);


CREATE TABLE tblOrderDetail (
    id INT AUTO_INCREMENT PRIMARY KEY,
    tblOrderId INT NOT NULL,
    tblProductId INT NOT NULL,
    quantity INT NOT NULL,
    price FLOAT NOT NULL,
    
    FOREIGN KEY (tblOrderId) REFERENCES tblOrder(id), 
    FOREIGN KEY (tblProductId) REFERENCES tblProduct(id) 
);

CREATE TABLE tblCart (
    id INT PRIMARY KEY AUTO_INCREMENT,
    lastModifiedTime DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    tblUserid INT NOT NULL UNIQUE, 
    
    FOREIGN KEY (tblUserid) REFERENCES tblUser(id)
);

CREATE TABLE tblCartDetail (
    id INT PRIMARY KEY AUTO_INCREMENT,
    quantity INT NOT NULL DEFAULT 1,
    createdTime DATETIME DEFAULT CURRENT_TIMESTAMP,

    tblProductid INT NOT NULL,

    tblCartid INT NOT NULL,

        FOREIGN KEY (tblProductid) REFERENCES tblProduct(id),

        FOREIGN KEY (tblCartid) REFERENCES tblCart(id),

    UNIQUE KEY uk_cart_product (tblCartid, tblProductid)
);




